class Card extends Component {
    constructor () {
        super()
        this.state = {
            movie: []
        }
    }
    componentDidMount() {
        fetch('https://api.themoviedb.org/3/movie/550?api_key=544297d08ee9679e6641d18e5056a278')
        .then(response => response.json())
        .then(data => {this.setState({movie: data})});
    }
    render() {
        const { image, Plot} = this.state.movie;
